import React,{Component} from 'react';

class PostForm extends Component{
  constructor(props){
    super(props);
  }

  render(){
    return (
      <div>
        <h1>Add Post</h1>
        <form>
          <div>
            <label>Title: </label><br />
            <input type="text"  name="title" />
          </div>
          <br />
          <div>
            <label>Body: </label><br />
            <textarea type="body" />
          </div>
          <br />
          <button type="submit">Submit</button>
        </form>
      </div>
    )
  }
}

export default PostForm;
